import React, {Component} from 'react';
import './App.css';

class App extends Component {
    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <h2>Welcome to React</h2>
                </header>
                <p className="App-intro">
                    To get started, edit <a href="App.js"><code>src/App.js</code></a> and save to reload
                </p>
            </div>
        );
    }
}

export default App;
